import "./App.css";
import axios from "axios";

axios
  .post("/?", {
    firstName: "Finn",
    lastName: "Williams",
  })
  .then(
    (response) => {
      console.log(response);
    },
    (error) => {
      console.log(error);
    }
  );

function App() {
  return <div className="App"></div>;
}

export default App;
